export default (function(a,b,c,d,e,f,g,h,i,j){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:f,pageSize:25,pageCount:f,total:5}}},cdRh4C1jut:{data:{id:2460,attributes:{imdbId:"tt0816711",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNDQ4YzFmNzktMmM5ZC00MDZjLTk1OTktNDE2ODE4YjM2MjJjXkEyXkFqcGdeQXVyNTA4NzY1MzY@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"7.0\u002F10"},{Source:"Rotten Tomatoes",Value:"66%"},{Source:"Metacritic",Value:"63\u002F100"}],item_lang:{data:{id:3123,attributes:{title:d,plot:"Life for former United Nations investigator Gerry Lane and his family seems content. Suddenly, the world is plagued by a mysterious infection turning whole human populations into rampaging mindless zombies. After barely escaping the chaos, Lane is persuaded to go on a mission to investigate this disease. What follows is a perilous trek around the world where Lane must brave horrific dangers and long odds to find answers before human civilization falls.",slug:"world-war-z"}}},books:{data:[{id:11890,attributes:{title:d,description:g,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=km1lAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:true,published:"2006-01-01",publisher:"Crown Pub",subtitle:h}},{id:11891,attributes:{title:d,description:g,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=YKtQPwAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2007-03-01",publisher:i,subtitle:h}},{id:11892,attributes:{title:"Max Brooks Boxed Set",description:"Offers zombie survival skills and an account of the conflict between humankind and hordes of the predatory undead, told from the survivors perspective.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=GEkvmQEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:c,published:"2013-04-30",publisher:"Broadway Books",subtitle:"World War Z, the Zombie Survival Guide"}},{id:11893,attributes:{title:"The Zombie Survival Guide: Recorded Attacks",description:"Those who don’t learn from history are condemned to repeat it. From the Stone Age to the information age, the undead have threatened to engulf the human race. They’ re coming. They’re hungry. Don’t wait for them to come to you! This is the graphic novel the fans demanded: major zombie attacks from the dawn of humanity. On the African savannas, against the legions of ancient Rome, on the high seas with Francis Drake . . . every civilization has faced them. Here are the grisly and heroic stories–complete with eye-popping artwork that pulsates with the hideous faces of the undead. Organize before they rise! Scripted by the world’s leading zombie authority, Max Brooks, Recorded Attacks reveals how other eras and cultures have dealt with–and survived– the ancient viral plague. By immersing ourselves in past horror we may yet prevail over the coming outbreak in our time.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=AQYCVRVsMCkC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a,"Ibraim Roberson"],firstBook:c,published:"2010-10-05",publisher:j,subtitle:i}},{id:11894,attributes:{title:"The Zombie Survival Guide",description:"From the author of the #1 New York Times bestseller, World War Z, The Zombie Survival Guide is your key to survival against the hordes of undead who may be stalking you right now. Fully illustrated and exhaustively comprehensive, this book covers everything you need to know, including how to understand zombie physiology and behavior, the most effective defense tactics and weaponry, ways to outfit your home for a long siege, and how to survive and adapt in any territory or terrain. Top 10 Lessons for Surviving a Zombie Attack 1. Organize before they rise! 2. They feel no fear, why should you? 3. Use your head: cut off theirs. 4. Blades don’t need reloading. 5. Ideal protection = tight clothes, short hair. 6. Get up the staircase, then destroy it. 7. Get out of the car, get onto the bike. 8. Keep moving, keep low, keep quiet, keep alert! 9. No place is safe, only safer. 10. The zombie may be gone, but the threat lives on. Don’t be carefree and foolish with your most precious asset—life. This book is your key to survival against the hordes of undead who may be stalking you right now without your even knowing it. The Zombie Survival Guide offers complete protection through trusted, proven tips for safeguarding yourself and your loved ones against the living dead. It is a book that can save your life.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=4mcT7A371xQC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:c,published:"2003-09-23",publisher:j,subtitle:"Complete Protection from the Living Dead"}}]}}},meta:{}}},prerenderedAt:1682568368967}}("Max Brooks","movie",null,"World War Z","series",1,"An account of the decade-long conflict between humankind and hordes of the predatory undead is told from the perspective of dozens of survivors who describe in their own words the epic human battle for survival.","An Oral History of the Zombie War","","Del Rey"))